import React, { useState, useEffect } from "react";
import "../styles/App.css";
import "../styles/styles.css"; // Import the Figma styles

const HomePage = () => {
  const [location, setLocation] = useState({ latitude: 32.9859827, longitude: -96.7512878 });
  const [error, setError] = useState("");
  const [searchQuery, setSearchQuery] = useState(""); // State for search input

  const getLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setLocation({
            latitude: position.coords.latitude,
            longitude: position.coords.longitude,
          });
          setError("");
        },
        (err) => {
          switch (err.code) {
            case err.PERMISSION_DENIED:
              setError("User denied the request for Geolocation.");
              break;
            case err.POSITION_UNAVAILABLE:
              setError("Location information is unavailable.");
              break;
            case err.TIMEOUT:
              setError("The request to get user location timed out.");
              break;
            default:
              setError("An unknown error occurred.");
          }
        }
      );
    } else {
      setError("Geolocation is not supported by this browser.");
    }
  };

  useEffect(() => {
    if (window.google) {
      const map = new window.google.maps.Map(document.getElementById("map"), {
        center: { lat: location.latitude, lng: location.longitude },
        zoom: 10,
      });

      new window.google.maps.Marker({
        position: { lat: location.latitude, lng: location.longitude },
        map: map,
        title: "You are here!",
      });
    }
  }, [location]);

  const handleSearch = (event) => {
    setSearchQuery(event.target.value);
    console.log("Search Query:", event.target.value); // Handle search logic here
  };

  const renderScrollableSection = (title, places) => (
    <div>
      <h3 className="section-title">{title}</h3>
      <div
        style={{
          display: "flex",
          overflowX: "auto",
          gap: "20px",
          padding: "10px 0",
        }}
      >
        {places.map((place, index) => (
          <div
            key={index}
            style={{
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <div
              style={{
                width: "99px",
                height: "99px",
                backgroundColor: "#d9d9d9",
                borderRadius: "50%",
                marginBottom: "5px",
              }}
            ></div>
            <p style={{ fontSize: "14px", color: "#333" }}>{place}</p>
          </div>
        ))}
      </div>
    </div>
  );

  return (
    <div className="homepage">
      <div className="content-wrapper" style={{ marginLeft: "200px" }}>
        <div className="div">
          {/* Search Bar */}
          <div className="search-bar">
            <input
              type="text"
              className="search-input"
              placeholder="Search..."
              value={searchQuery}
              onChange={handleSearch}
            />
          </div>

          {/* Map */}
          <div id="map" className="rectangle"></div>

          <p className="text-wrapper">
            Letâ€™s Transcend Time/Living through the past
          </p>

          {/* Recent Exploration Section */}
          {renderScrollableSection("Recent Exploration", [
            "Place 1",
            "Place 2",
            "Place 3",
            "Place 4",
            "Place 5",
          ])}

          {/* Historical Hotspots Section */}
          {renderScrollableSection("Historical Hotspots", [
            "Hotspot 1",
            "Hotspot 2",
            "Hotspot 3",
            "Hotspot 4",
            "Hotspot 5",
          ])}

          {/* Self-Guided Tours Section */}
          {renderScrollableSection("Self-Guided Tours", [
            "Tour 1",
            "Tour 2",
            "Tour 3",
            "Tour 4",
            "Tour 5",
          ])}

          {/* Community Posts Section */}
          {renderScrollableSection("Community Posts", [
            "Post 1",
            "Post 2",
            "Post 3",
            "Post 4",
            "Post 5",
          ])}

          {/* Map Controls */}
          <div className="container" style={{ marginTop: "20px" }}>
            <button className="button" onClick={getLocation}>
              Show My Location
            </button>
            {error && <p id="demo" style={{ color: "red" }}>{error}</p>}
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
